description:
Round Trip to Heaven 1992 Corey Feldman Zach Galligan (VHS-RIP)

If you are looking to see a bunch of cute LA girls in a far-fetched plot where Ray Sharkey chases down Zach Galligan and Corey Feldman, who don't know they have stolen money stashed in the car they &quot;borrowed&quot; for the weekend to go watch a model search contest in Palm Springs, you will like this movie. Fun, entertaining, fast-paced, and plenty of LA humor. Best for viewers over age 16, as some nudity and adult (sexual) language. 

